About Game:
************
Play Delicious 10- Emily's New Beginning and welcome a beautiful new member to the Delicious family!

After living on a pink cloud for over a year Emily decides to reopen Emily's Place. However, with a baby to take care of, things will be different and a lot more challenging. Challenges are challenges as they say and who cannot love a young one? But some restaurant customers hate Paige!
Can you help Emily combine running her restaurant with being a good mother?

Game Features:
**************
capture memorable moments such as the baby's first steps and her first birthday
discover various new restaurant locations and delicious new menus
catch up with Francois, Angela, and the others and surround yourself with love
combine parenthood and running a restaurant with all its daily challenges

